var convertData = function (mydata) {
    var res = [];
    for (var i = 0; i < mydata.length; i++) {
        var geoCoord = geoCoordMap[mydata[i].name];
        if (geoCoord) {
            res.push({
                name: mydata[i].name,
                value: geoCoord.concat(mydata[i].value)
            });
        }
    }
    return res;
};

